example {X Y Z : Type*} {F : Filter X} {G : Filter Y} {H : Filter Z} {f : X ‚Üí Y} {g : Y ‚Üí Z}
    (hf : Tendsto‚ÇÅ f F G) (hg : Tendsto‚ÇÅ g G H) : Tendsto‚ÇÅ (g ‚àò f) F H  := by
    map (g ‚àò f) F = map g (map f F) := by rw [map_map]

